import React, { Component } from 'react'
import styled from 'styled-components'

// Components
import FullScreen from '../fullscreen'
import Title from '../title'

const ExperinceWrapper = styled(FullScreen)`
  width: 30%;
  padding-left: 50px;
  padding-right: 50px;
  display: inline-block;
  vertical-align: top;
`

const ExperinceContainer = styled.div`
  margin: 0 0 20px;
`

const ExperinceTitle = styled.p`
  margin: 0;
`

const ExperinceTime = styled.p`
  color: #a7c7f9;
  font-size: 0.8rem;
  margin: 0;
`

const ExperinceDetail = styled.p`
  color: #afb5bf;
  font-size: 0.8rem;
  margin: 0;
`

class Working extends Component {
  render() {
    return (
      <ExperinceWrapper>
        <Title>Working</Title>
        <ExperinceContainer>
          <ExperinceTitle>Askforanywork</ExperinceTitle>
          <ExperinceTime>June 2017 - Now</ExperinceTime>
          <ExperinceDetail>
            Part-Time: Full-Stack Web Development
          </ExperinceDetail>
        </ExperinceContainer>
        <ExperinceContainer>
          <ExperinceTitle>
            Institute of High Performance Computing in Singapore
          </ExperinceTitle>
          <ExperinceTime>May 2018 - Aug 2018</ExperinceTime>
          <ExperinceDetail>
            Internship: Big Data Analytics and Machine Learning
          </ExperinceDetail>
        </ExperinceContainer>
        <ExperinceContainer>
          <ExperinceTitle>Artificial Anything</ExperinceTitle>
          <ExperinceTime>Jul 2017</ExperinceTime>
          <ExperinceDetail>
            Internship: Embedded System Implementation
          </ExperinceDetail>
        </ExperinceContainer>
      </ExperinceWrapper>
    )
  }
}

export default Working
